commit_list.message:
Change the items list into a hash.

Makes things better on the redux side.

 [
  { title: 'Station 44025',
    id: '44025'
  },
  { title: 'Station 44066',
    id: '44066' }
]

becomes:

{
    "44025": {
        id: "44025",
        title: "Station 44025 - LONG ISLAND - 30 NM SOUTH OF ISLIP, NY"
    },
    "44066": {
        id: "44066",
        title: "Station 44066 - TEXAS TOWER #4 - 75 NM EAST OF LONG BEACH, NJ"
    }
}
